memberdef.initializer:
= requires(T& t, Arg& a) {
    { t.operator&(a) } -> std::convertible_to<T&>;
}

= requires(const T& t) {
    { T::IsReader || T::IsWriter } -> std::same_as<bool>;
    { t.operator bool() } -> std::same_as<bool>;

    requires HasAmpOp<T, bool>;
    requires HasAmpOp<T, int32>;
    requires HasAmpOp<T, int64>;
    requires HasAmpOp<T, uint32>;
    requires HasAmpOp<T, uint64>;
    requires HasAmpOp<T, double>;
    requires HasAmpOp<T, float>;
    requires HasAmpOp<T, Raven::Meta::Variant>;
}
&&requires(T& t) {
    { t.StartObject() } -> std::convertible_to<T&>;
    { t.EndObject() } -> std::same_as<T&>;
}
&&requires(T& t, const std::string_view c) {
    { t.Member(c) } -> std::same_as<T&>;
}
&&requires(const T& t, const std::string_view c) {
    { t.HasMember(c) } -> std::same_as<bool>;
}
